import React from 'react';
import {Link} from "react-router-dom";
import { alpha,
         AppBar, 
         CssBaseline,
         InputBase,
         makeStyles, 
         SearchIcon,   
         Toolbar,
         Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    boxShadow:"#e05929",
  },
  barItems:{
    paddingLeft: 13,
    color: 'inherit',
    textDecoration: 'inherit'
  }, 
  title: {
    marginRight: theme.spacing(2)
  },
  searchBar: {
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: alpha(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: alpha(theme.palette.common.white, 0.25),
    },
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing(1),
      width: 'auto',
    },
  },
  searchIcon: {
    padding: theme.spacing(0, 2),
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },

}));

export default function Header() {
    //#e05929;
    const classes = useStyles();
    return(
        <div className={classes.root}>
            <CssBaseline/>
            <AppBar positon="static">
                <Toolbar>
                    <Typography variant="h5" noWrap className={classes.title}>
                        HCA Healthcare Video Library
                    </Typography>
                    <Link to="/" className={classes.barItems}>
                      <Typography variant="h6" textAlign="center">Covid Videos</Typography>
                    </Link>
                    <Link to="/:otherVideos" className={classes.barItems}>
                      <Typography variant="h6" textAlign="center">Other Videos</Typography>
                    </Link>
                    <div className={classes.searchBar}>
                      <div className={classes.searchIcon}>
                          <SearchIcon />
                      </div>
                      <InputBase
                        placeholder="Search…"
                        classes={{
                          root: classes.inputRoot,
                          input: classes.inputInput,
                        }} 
                        inputProps={{ 'aria-label': 'search' }}
                      />
                    </div>
                </Toolbar>
            </AppBar>
        </div> 
    );
}
